ub = 400 / (4.53*10^-4 * 6 * 0.3 * 3100 * cos(deg2rad(27)));
tol = 5e-1;

[opt_t_f, optval, state_history, thrust_history] = gss(lb, ub, tol, r0, rdot0, rf, 'Fuel'); %[output:4174b0f2] %[output:13ed6ac7]

